    false,nt"url": null,nt"notes": "Between 1984 January - 2002 June, personnel
    from NMFS/PIFSC/FRMD/FMB/FMAP and Hawaii Department of Aquatic Resources (DAR) conducted
    port sampling at the United Fishing Agency (UFA) Fish Auction. They recorded the
    total landing at the UFA Fish Auction, with a frequency of six times a week during
    the earlier years to twice a week during the later years. nnIn 2000 January, DAR
    implemented a Dealer Data collection procedure that receives reports from the fish
    dealers that are more complete and covers more than just the auction. This Dealer
    Data takes the place of the UFA Sampling Data, and after a 2.5 year overlap, the
    collection of the UFA Sampling Data was discontinued in 2002 June. The DAR Dealer
    Data is archived and documented separately.n",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
